      type: "localeString",
      options: {
        isHighlighted: true,
        collapsible: true,
      },
      description: ALT_TEXT_DESCRIPTION,
    },
    {
      name: "caption",
      title: "Caption",
      type: "localeString",
      options: {
        isHighlighted: true,
        collapsible: true,
      },
      description: "Give a short caption for this image.",
    },
  ],
  preview: {
    select: {
      imageUrl: "asset.url",
      title: "caption",
    },
  },
};

